import logo from './logo.svg';
import './App.css';
import Loading from './loading/loading';
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch,
  Routes
} from 'react-router-dom';
import Full from './Home/full';
import MainBlog from './Blog/main-blog';
import BlogPage from './Blog/single-blog';
function App() {
  return (
    <Router>
    <Routes>
    <Route path='/' element={<Loading />} exact />
    <Route path="/event" element={<Full></Full>} />
    <Route path="/blogs" element={<MainBlog></MainBlog>} />
    <Route path="/blogs/1" element={<BlogPage page={"one"}></BlogPage>} />
    <Route path="/blogs/2" element={<BlogPage  page={"two"}></BlogPage>} />
    <Route path="/blogs/3" element={<BlogPage  page={"three"}></BlogPage>} />
    <Route path="/blogs/4" element={<BlogPage page={"four"}></BlogPage>} />
    <Route path="/blogs/5" element={<BlogPage page={"five"}></BlogPage>} />
    <Route path="/blogs/6" element={<BlogPage page={"six"}></BlogPage>} />
    </Routes>
  </Router>
  );
}

export default App;
